import ReactDOM from 'react-dom/client';
const root= ReactDOM.createRoot(document.getElementById ("root"))

function One(){
  var num=56
  return(
    <div>
    <h1>i am one</h1>
    <Two num={num}></Two>
    </div>
  )
}
function Two(num){
  return(
    <div>
    <h1>i am two</h1>
    <Three num={num.num}></Three>
    </div>
  )
}
function Three(num){
  return(
    <div>
    <h1>i am Three{num}</h1>
    </div>
  )
}
root.render(<One></One>)

